import React from 'react';
import "./Feed.css";
import StoryReel from "./StoryReel";
import MessageSender from "./MessageSender";
import Post from "./Post";
import isaac from "./images/isaac.JPG"

function Feed() {
    return (
        <div className='feed'>
            <StoryReel/>
            <MessageSender/>

            <Post
                profilePic={isaac}
                message='This is amazing'
                timestamp='12:16'
                username="Isaac Ndubuisi"
                image="https://i.ytimg.com/vi/phs3i9Y6gx8/maxresdefault.jpg"
            />
        </div>
    );
}

export default Feed;
